import { isEmpty as _isEmpty } from 'underscore';
import React, { Component }  from 'react';



export function RegisterForm() {
    return (
      <div className="register_screen">

        <div className="create_account_form">
          <h1>Create account</h1>
          
          <form onSubmit={this.saveAndContinue}>

            <div 
              text="First Name" 
              ref="firstName"
              validate={this.isEmpty}
              value={this.state.firstName}
              onChange={this.handleFirstInput} 
              emptyMessage="First name can't be empty"
            /> 

            <div 
              text="Last Name" 
              ref="lastName"
              validate={this.isEmpty}
              value={this.state.lastName}
              onChange={this.handleLastInput} 
              emptyMessage="Last name can't be empty"
            /> 
            <div
              text="Date of Birth" 
              ref="birthDate"
              validate={this.isEmpty}
              value={this.state.birthDate}
              onChange={this.handleBirthDateInput} 
              emptyMessage="Date of birth can't be empty"
            /> 

            <div
              text="Email Address" 
              ref="email"
              type="text"
              defaultValue={this.state.email} 
              validate={this.validateEmail}
              value={this.state.email}
              onChange={this.handleEmailInput} 
              errorMessage="Email is invalid"
              emptyMessage="Email can't be empty"
              errorVisible={this.state.showEmailError}
            />

            <div 
              text="Phone Number" 
              ref="phoneNumber"
              validate={this.isEmpty}
              value={this.state.phoneNumber}
              onChange={this.handlePhoneNumberInput} 
              emptyMessage="Phone number can't be empty"
            /> 

            <div
              text="Password" 
              type="password"
              ref="password"
              validator="true"
              minCharacters="8"
              requireCapitals="1"
              requireNumbers="1"
              forbiddenWords={this.state.forbiddenWords}
              value={this.state.passsword}
              emptyMessage="Password is invalid"
              onChange={this.handlePasswordInput} 
            /> 

            <div
              text="Confirm password" 
              ref="passwordConfirm"
              type="password"
              validate={this.isConfirmedPassword}
              value={this.state.confirmPassword}
              onChange={this.handleConfirmPasswordInput} 
              emptyMessage="Please confirm your password"
              errorMessage="Passwords don't match"
            /> 

            <button 
              type="submit" 
              className="button button_wide">
              Submit
            </button>

          </form>

        </div>

      </div>
    );
  }
    
;
    
export default Register;
